import React from "react";
import { Link } from "react-router-dom";
import confirmationillustration from "../../assets/confirmationillustration.png";

const Confirmation = () => {
  return (
    <div className="App">
      <img src={confirmationillustration} alt="" />

      <h1>
        CONFIRMAr O ENVIO DO
        <br />
        PEDIDO PARA Produção ?
      </h1>

      <div className="check_Reorder">
        <Link className="Reorder" to="/select">
          <h1>ADICIONAR OUTRA PIZZA</h1>
        </Link>
        <Link className="Checkvalid" to="/confirmation">
          <h1>FINALIZAR PEDIDO</h1>
        </Link>
      </div>
    </div>
  );
};

export default Confirmation;
